// AddActivityPage.tsx
import React, { useState } from 'react';
import AddActivityForm from '../components/AddActivityForm';
import { Activity } from '../types/Activity';

interface AddActivityPageProps {
  activities: Activity[];
  onAddActivity: (activity: Activity) => void; // Funktion för att uppdatera aktivitetslistan
}

function AddActivityPage(props: AddActivityPageProps): JSX.Element {
  const { activities, onAddActivity } = props;

  // Funktion för att lägga till en ny aktivitet i listan av aktiviteter
  const handleAddActivity = (activity: Activity) => {
    // Uppdatera aktivitetslistan med den nya aktiviteten
    onAddActivity(activity);
  };

  return (
    <>
      <h1>add page</h1>

      {/* Rendera AddActivityForm och skicka med funktionen handleAddActivity */}
      <AddActivityForm onAddActivity={handleAddActivity} />

      {/* Rendera listan med aktiviteter */}
      <ul>
        {activities.map((activity) => (
          <li key={activity.id}>
            <h2>{activity.title}</h2>
            <p>{activity.content}</p>
            <p>Date: {activity.date}</p>
            <p>Max Count: {activity.maxCount}</p>
          </li>
        ))}
      </ul>
    </>
  );
}

export default AddActivityPage;
